import React, { Component } from "react";
import { Card } from "components/Card/Card.jsx";
import { StatsCard } from "components/StatsCard/StatsCard.jsx";
import { Grid, Row, Col, Alert } from "react-bootstrap";
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'
import "assets/css/customcss.css"


class Login extends Component {
  render() {
    return (

      <div className="bg_site content site_container ">
        <Col md={4}>
          <div className="form_conteint bg_wt col-lg-12">
            <div className="logoLogin">

            </div>

            <Form className="center form" >
              <Form.Group controlId="formnom">
                <Form.Label>Nom :</Form.Label>
                <Form.Control type="text" placeholder="Enter le mon" />
              </Form.Group>

              <Form.Group controlId="formnom">
                <Form.Label>Mot de pass :</Form.Label>
                <Form.Control type="password" placeholder="Enter le Postnom" />
              </Form.Group>

              <Form.Group controlId="exampleForm.ControlSelect1">
              <Button variant="primary"  type="submit" className="col-lg-12" >
                LOGIN
              </Button>

              </Form.Group>


            </Form>
          </div>

        </Col>
        <Col md={8}>
        </Col>




      </div>


    );
  }
}

export default Login;
